import React, { useState } from 'react';
import globalReducer from './reducers';
import { createStore } from 'redux';
import { Provider } from 'react-redux';
import { BrowserRouter, Routes, Switch } from 'react-router-dom'
import { ActionMain } from './components/MAIN/ActionMain';
import { PlayMain } from './components/PLAY/PlayMain';
import { Sell } from './components/SELL/Sell';
import { Buy } from './components/BUY/Buy';
import { CreateRoom } from './components/PLAY/CreateRoom';


//create store to exchange data
const store = createStore(globalReducer, window.__REDUX_DEVTOOLS_EXTENSION__ && window.__REDUX_DEVTOOLS_EXTENSION__());

export const Main = () => {

  return (

    <BrowserRouter>
      <Routes>
        <Switch>
          <Route path="/"><ActionMain/></Route>
          <Route path="/play"><PlayMain/></Route>
          <Route path="/sell"><Sell/></Route>
          <Route path="/buy"><Buy/></Route>
          <Route path="/create/room"><CreateRoom/></Route>
          <Route></Route>
        </Switch>
      </Routes>
    </BrowserRouter>
  );
}
